import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './apiData.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import XMLParser from 'react-xml-parser';

const GetData = () => {
  const [apiData, setApiData] = useState();
  const api = 'https://front-end-test-bvhzjr6b6a-uc.a.run.app';

  useEffect(() => {
    axios.get(api)
      .then(res => {
        setApiData(res.data.map((element, i) => {
          element = JSON.parse(JSON.stringify(element).replace("tapons", "tampons"));

          // console.log(element);

          if (typeof element.tampons === 'string') {
            // let parser = new DOMParser();
            // let xmlDoc = parser.parseFromString(element.tampons, "text/xml");
            const dfdff = new XMLParser().parseFromString(element.tampons).children;
            // element.tampons = xmlDoc;
            console.log(dfdff);
            dfdff.map((el) => {
              el.children.map((inner) => {
                console.log(inner.name);
              })
            })
          }

          // console.log(element.tampons);
          // console.log(element.tampons.tampon.size);
          // size
          // coating
          // amount

          return (
            <div className="product-wrapper col-4" key={i}>
              <img className="product-img" alt="missing img" src={element.productImage} />
              <p>
                {element.currency}
              </p>
              <p>{element.price}</p>

              <div>

              </div>
            </div>
          );
        }));

      })
  },[]);

  return (
   <div className="container">
    <div className="row">
      {apiData}
    </div>
   </div>
  )
};

export default GetData;
